import { Component } from 'react';
import { Grid, Typography, Button, Stack, Badge} from '@mui/material';
import { motion, AnimatePresence } from 'framer-motion';
import ModalComponent from './components/ModalComponent';
import './App.css';

import { gsap, InertiaPlugin, Draggable, TextPlugin } from "gsap/all";
import { homePageImageMeta } from './assets/images/homePageImageMeta';

const navData = ["Schedule",
"Travel Requirements",
"Registry",
"Gallery",
"Things To Do",
"FAQs"]
class HomePage extends Component {
  constructor(props) {
    super(props);
      this.state = {
        isModalOpen: false,
    };



    // this.imagePath = './assets/images/';
    this.openModal = this.openModal.bind(this);
    this.closeModal = this.closeModal.bind(this);
  }

  openModal() {
    this.setState(() => ({ isModalOpen: true }));
  }

  closeModal() {
    this.setState(() => ({ isModalOpen: false }));
  }

  componentDidMount() {
    gsap.registerPlugin(Draggable, InertiaPlugin, TextPlugin);

    Draggable.create(".draggable", {
      bounds: ".fullpage-container",
      inertia: true,
      onClick: () => {
       this.openModal();
        // e.target.style.backgroundColor= 'blue'
    }});

    Draggable.create(".rotation", {
      type: "rotation",
      inertia: true,
      onClick: (e) => {
        console.log('CLICKED', e.target)
        // e.target.style.backgroundColor= 'blue'
    }});

     gsap.to(".title-home", {
        duration: 3,
        text: "Jade & Seka",
        ease: "power1.out",
    });
  }


  render() {

    // Helper to render images by section and row
    const renderImages = (section, row) => {
      return homePageImageMeta
        .filter(img => img.position.section === section && img.position.grid.row === row)
        .map((img, idx) => {
          const commonProps = {
            key: img.name,
            alt: img.alt,
            className: 'draggable image-context',
            style: { width: img.width, height: img.height }
          };
          if (img.motion) {
            return (
                 <Grid item key={img.name}>
                  <Badge badgeContent={img.key} color='primary'   anchorOrigin={{
    vertical: 'bottom',
    horizontal: 'left',
  }}
>
                    <motion.img
                      src={img.src}
                      initial={{ opacity: 0 }}
                      animate={{ opacity: 1 }}
                      transition={{ duration: img.transitionDuration || 2 }}
                      {...commonProps}
                    />
                  </Badge>
                </Grid>
            );
          } else {
            return (
              <Grid item key={img.name}>
                <Badge badgeContent={img.key} color='primary'   anchorOrigin={{
    vertical: 'bottom',
    horizontal: 'left',
  }}
>
                  <img src={img.src} alt={img.alt} {...commonProps} />
                </Badge>
              </Grid>
            );
          }
        });
    };

    return (
      <div>
        <Grid
          container
          direction="column"
          justifyContent="center"
          alignItems="center"
          className="fullpage-container"
          style={{ minHeight: '100vh' }}
        >
          {/* Top images row */}
          <Grid container direction="row" justifyContent="center" spacing={2}>
            {renderImages('top', 1)}
          </Grid>


          {/* Centered Text */}
          <Grid justifyContent="center" item>
            <Stack alignItems="center" justifyContent="center">
              <Typography sx={{
                fontFamily: "Sekasfont-Regular",
                fontSize: "5em",
                fontWeight: "400"
              }} variant="h2" align="center">
                Jade & Seka
              </Typography>
              <Button justifyContent="center" onClick={this.openModal} sx={{ fontFamily: "Sekasfont-Regular", fontSize:"18px", backgroundColor: "#2C3607", color: "white" }}>RSVP</Button>
              <ol className="nav-inline-list">
                {navData.map((listItem, idx) => [
                  <li key={listItem}>{listItem}</li>,
                  idx === 2 ? <br key="break" /> : null
                ])}
              </ol>
            </Stack>
          </Grid>


          {/* Middle images row and nav */}
          <Grid container direction="row" justifyContent="center" spacing={4}>
            {renderImages('bottom', 2)}
          </Grid>

          {/* Bottom three images */}
        </Grid>
        {this.state.isModalOpen && <ModalComponent open={this.state.isModalOpen} onClose={this.closeModal}>
          <Typography variant="h6" id="modal-title">
            Modal Title
          </Typography>
          <Typography id="modal-description">
            This is the modal content.
          </Typography>
        </ModalComponent>}
      </div>
    );
  }
}


export default HomePage;
